    <div>
    <p class=MsoNormal><span style='font-size:18.0pt;line-height:115%'>- El
    voleibol se juega con dos equipos de seis jugadores cada uno.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:18.0pt;line-height:115%'>- El
    objetivo es golpear la pelota sobre la red y hacer que caiga en el campo
    del equipo contrario.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:18.0pt;line-height:115%'>- Un
    partido se juega al mejor de cinco sets. Cada set se juega hasta que un
    equipo alcanza 25 puntos, con una ventaja de al menos dos puntos.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:18.0pt;line-height:115%'>- Los
    jugadores pueden tocar la pelota con cualquier parte del cuerpo, pero no
    pueden agarrar o lanzar la pelota.<o:p></o:p></span></p>
    </div>
